var m__hero_array = [];

function initHeroAnim() {
	var $m__hero_overlay = $('.m__hero_overlay');
	var $position_shift = 140;

	if (!$m__hero_overlay.length) {
		return;
	}

	$window.on('load', load);

	function load() {
		$m__hero_overlay.each(function () {
			var $this = $(this);
			var initial_op = 0;
			if ($this.hasClass('opacity_mod')) {
				initial_op = 0;
			}

			var tl = TweenMax.fromTo($this, 2, {
						opacity: initial_op,
						ease: $easeOut_1,
						paused: true
					},
					{
						opacity: .8,
						ease: $easeOut_1,
						paused: true
					});

			var sub_array = {
				overlay: $this,
				height: $this.height(),
				position: $this.offset().top,
				animation: tl
			};

			m__hero_array.push(sub_array);
		});

		$window.on('resize', $.throttle(250, resize));

		TweenLite.ticker.addEventListener("tick", anim_f);
	}

	function resize() {
		$.each(m__hero_array, function (key, value) {
			value.position = value.overlay.offset().top;
		});
	}

	var past_$scrollTopGl = $scrollTopGl;

	function anim_f() {
		if (past_$scrollTopGl !== $scrollTopGl) {
			if(window_w < 1440){
				$position_shift = 90;
			}else {
				$position_shift = 140;
			}

			$.each(m__hero_array, function (key, value) {
				var $progress = 0;
				var $position = value.position - $position_shift;

				if ($scrollTopGl > $position) {
					$progress = ($scrollTopGl - $position) / value.height;
				}

				if ($progress <= 1) {
					if($scrollTopGl === 0){
						value.animation.progress(0);
					}
					else {
						value.animation.progress($progress);
					}
				}

			});

			past_$scrollTopGl = $scrollTopGl;
		}
	}
}


