/**
 * Universal - Photo & Video Carousel Module
 */

function initAllPhotoVideoCarousel() {
  $('.carousel_module_list').each(
      function () {
        var thatElem = $(this);
        photoVideoCarousel(thatElem);
      }
  );
}

function photoVideoCarousel(carouselItem) {
  var prefix;
  var carousel;
  var slide_num;
  var slide_all;
  var childrenClass;
  var superIndex;
  var direction;
  var nextSlide, prevSlide, indexCurrent;
  var carouselLen, indexLast;
  var typeAnimation = Power1.easeInOut;


  hasSafari();
  initCarouselModule();

  function initCarouselModule() {
    var carouselImagesArray = [];
    var carouselDescArray = [];
    var carouselTitleArray = [];
    var carouselLinkArray = [];
    carousel = carouselItem;
    var carouselModule = carousel.parent('.o__carousel_module');

    slide_num = $('.slide_num', carouselModule);
    slide_all = $('.slide_all', carouselModule);


    if (carousel.length < 1) {
      return;
    }

    // create Array elements-text and hide all them
    $(".carousel_module_item", carousel).each(function () {
      var $this = $(this);
      var imgEl = $(".carousel_img_hold", $this);
      var descEl = $(".carousel_d_desc", $this);
      var titleEl = $(".carousel_d_title", $this);
      var linkEl = $(".carousel_read_more", $this);

      carouselImagesArray.push(imgEl);
      carouselDescArray.push(descEl);
      carouselTitleArray.push(titleEl);
      carouselLinkArray.push(linkEl);

      hideAllNonActiveElem(descEl);
      hideAllNonActiveElem(titleEl);
      hideAllNonActiveElem(linkEl);


    });


    //show first element-text and show progress bar
    carousel.on('init', function (event, slick) {
      carouselLen = carousel.find('.carousel_module_item').length;
      var item = carousel.find('.carousel_module_item');
      indexCurrent = carousel.find('.slick-slide.slick-current').index();

      prevSlide = item.eq(carouselLen - 1);
      nextSlide = item.eq(indexCurrent + 1);
      prevSlide.addClass('PREVSLIDE');
      nextSlide.addClass('NEXTSLIDE');

      addClassVideoIframe();
      emulationSlickArrows();
      setStartPosition(carouselLinkArray[0]);
      initCarouselAnimationItem(carouselDescArray[0]);
      initCarouselAnimationItem(carouselTitleArray[0]);
      initCarouselAnimationItem(carouselLinkArray[0]);

      getCountSlides(slick.$slides, slide_all);
      getCurrentSlide(slick, slide_num);

    });

    // init slick slider
    initSlickSlider(carousel);

    // there is animations with text and img

    carousel.on('beforeChange', function (event, slick, currentSlide, nextSlide) {


      TweenMax.set(carouselLinkArray[nextSlide], {xPercent: 100, opacity: 1, scale: 1});

      getCurrentSlide(slick, slide_num);
      childrenClass = carouselImagesArray[currentSlide].children().attr('class');


      if (childrenClass == 'iframeVideo' || childrenClass == 'html5Video') {
        superIndex = currentSlide;
      }
      else {
        superIndex = false
      }

      if ($('.slick_arrow_fake.next').hasClass('active')) {
        direction = 'right'
      }
      if ($('.slick_arrow_fake.prev').hasClass('active')) {
        direction = 'left'
      }

      if (direction === 'right') {

        TweenMax.fromTo(carouselLinkArray[nextSlide], .7, {xPercent: 100, opacity: 0, ease: typeAnimation}, {
          opacity: 1,
          xPercent: 0,
          ease: typeAnimation
        });
        TweenMax.fromTo(carouselLinkArray[currentSlide], .7, {xPercent: 0, opacity: 1, ease: typeAnimation, scale: 1}, {
          opacity: 0,
          xPercent: 100,
          scale: .7,
          ease: typeAnimation
        });

        TweenMax.fromTo(carouselImagesArray[nextSlide], .7, {xPercent: 100, ease: typeAnimation}, {
          xPercent: 0,
          ease: typeAnimation
        });

        TweenMax.fromTo(carouselImagesArray[currentSlide], .7, {xPercent: 0, ease: typeAnimation}, {
          xPercent: -100,
          ease: typeAnimation
        });

        moveSlideToRight(carouselDescArray, nextSlide, currentSlide);
        moveSlideToRight(carouselTitleArray, nextSlide, currentSlide);

      }
      else {
        TweenMax.fromTo(carouselLinkArray[nextSlide], .7, {xPercent: 100, opacity: 0, ease: typeAnimation}, {
          opacity: 1,
          xPercent: 0,
          ease: typeAnimation
        });
        TweenMax.fromTo(carouselLinkArray[currentSlide], .7, {xPercent: 0, opacity: 1, ease: typeAnimation, scale: 1}, {
          opacity: 0,
          xPercent: 100,
          scale: 0,
          ease: typeAnimation
        });

        TweenMax.fromTo(carouselImagesArray[nextSlide], .7, {xPercent: -100, ease: typeAnimation}, {
          xPercent: 0,
          ease: typeAnimation
        });
        TweenMax.fromTo(carouselImagesArray[currentSlide], .7, {xPercent: 0, ease: typeAnimation}, {
          xPercent: 100,
          ease: typeAnimation
        });

        moveSlideToLeft(carouselDescArray, nextSlide, currentSlide);
        moveSlideToLeft(carouselTitleArray, nextSlide, currentSlide);
      }

    });

    carousel.on('afterChange', function (event, slick, currentSlide) {
      $('video', carousel).attr('controls', 'controls');

      if (childrenClass == 'iframeVideo') {
        var elem = carouselImagesArray[superIndex].children();
        var pathElem = elem.attr('src');

        elem.attr('src', pathElem);
        superIndex = false;
      }

      if (childrenClass == 'html5Video') {

        carouselImagesArray[superIndex].children().get(0).pause();
        superIndex = false;
      }

      getCurrentSlide(slick, slide_num);
    });

  }

  function toggleClassArrowFake(elem) {
    var that = $(elem);
    $('.slick_arrow_fake').removeClass('active');
    if (!that.hasClass('active')) {
      that.addClass('active');
    }
  }

  function emulationSlickArrows() {
    var item = carousel.find('.carousel_module_item');
    carouselLen = carousel.find('.carousel_module_item').length;
    indexLast = carouselLen - 1;
    var itemLast = item.eq(indexLast);
    var itemZero = item.eq(0);

    $('.slick_arrow_fake.next', carousel.parent('.o__carousel_module')).on('click', function () {
      toggleClassArrowFake(this);
      carousel.slick("slickNext");
      indexCurrent = carousel.find('.slick-slide.slick-current').index();


      if (indexCurrent == indexLast) {
        prevSlide = item.eq(indexCurrent - 1);
        nextSlide = itemZero;
      }
      else if (indexCurrent == 0) {
        prevSlide = itemLast;
        nextSlide = item.eq(indexCurrent + 1);
      }
      else {
        prevSlide = item.eq(indexCurrent - 1);
        nextSlide = item.eq(indexCurrent + 1);
      }
      setClassSlides(prevSlide, nextSlide);
      direction = 'right';

    });
    $('.slick_arrow_fake.prev', carousel.parent('.o__carousel_module')).on('click', function () {
      toggleClassArrowFake(this);
      carousel.slick("slickPrev");
      indexCurrent = carousel.find('.slick-slide.slick-current').index();

      if (indexCurrent == indexLast) {
        prevSlide = itemZero;
        nextSlide = item.eq(indexCurrent - 1);
      }
      else if (indexCurrent == 0) {
        prevSlide = item.eq(indexCurrent + 1);
        nextSlide = itemLast;
      }
      else {
        prevSlide = item.eq(indexCurrent + 1);
        nextSlide = item.eq(indexCurrent - 1);
      }
      direction = 'left';
      setClassSlides(prevSlide, nextSlide);
    });
  }

  function setClassSlides(prev, next) {
    var prevCl = 'PREVSLIDE', nextCl = 'NEXTSLIDE';
    carousel.find('.' + prevCl).removeClass(prevCl);
    carousel.find('.' + nextCl).removeClass(nextCl);
    prev.addClass(prevCl);
    next.addClass(nextCl);
  }

  function initCarouselAnimationItem(elem) {
    TweenMax.to(elem, 1, {yPercent: 0, opacity: 1});
  }

  function hideAllNonActiveElem(array) {
    TweenMax.set(array, {yPercent: 2, opacity: 0});
  }

  function setStartPosition(elem) {
    TweenMax.fromTo(elem, .7, {xPercent: 100, ease: typeAnimation, opacity: 0}, {
      xPercent: 0,
      ease: typeAnimation,
      opacity: 1
    });
  }

  function moveSlideToRight(array, nextSlide, currentSlide) {
    TweenMax.set(array[nextSlide], {yPercent: 3, opacity: 0});
    TweenMax.to(array[currentSlide], .7, {yPercent: -3, opacity: 0, ease: typeAnimation});
    TweenMax.to(array[nextSlide], .7, {yPercent: 0, opacity: 1, delay: .7, ease: typeAnimation});
  }

  function moveSlideToLeft(array, nextSlide, currentSlide) {
    TweenMax.set(array[nextSlide], {yPercent: -3, opacity: 0});
    TweenMax.to(array[currentSlide], .7, {yPercent: 3, opacity: 0, ease: typeAnimation});
    TweenMax.to(array[nextSlide], .7, {yPercent: 0, opacity: 1, delay: .7, ease: typeAnimation});
  }

  function initSlickSlider(obj) {
    obj.slick({
      arrows: true,
      infinite: true,
      speed: 700,
      swipeToSlide: true,
      pauseOnFocus: false,
      pauseOnHover: false,
      fade: true,
      cssEase: 'ease-in-out'
    });
  }

  function getCurrentSlide(slick, elem) {
    var numCurrentSlide = slick.currentSlide;
    prefix = slick.currentSlide < 10 ? '0' : '';

    elem.text(prefix + (numCurrentSlide + 1));
  }

  function getCountSlides(slickSlides, elem) {
    prefix = slickSlides.length < 10 ? '0' : '';

    elem.text(prefix + slickSlides.length);

  }
}

//todo js fix
function addClassVideoIframe() {
  $('iframe').each(function () {
    var that = $(this);
    var path = that.attr('src');
    if (typeof path !== 'undefined' && path.length > 0) {
        if (path.indexOf('youtu.be') != -1) {
            changeUrlYoutube(path, that);
        }
    }
    else {
        return;
    }


    if (path.indexOf('youtube') != -1 || path.indexOf('youtu.be') != -1 || path.indexOf('vimeo') != -1) {
      that.addClass('iframeVideo');
    }
  });

}

//  video with short url doesn't show. it's fix;
function changeUrlYoutube(path, that) {
  var $ytshorturl = 'youtu.be/';
  var $ytlongurl = 'www.youtube.com/embed/';

  path = path.replace($ytshorturl, $ytlongurl);
  that.attr('src', path);
}

