function initEventsPages() {
  var $body = $('body');
  var mobile_point = 768;
  var buttonsBlock = $('.m__buttons_block_fixed');
  if (buttonsBlock.length) {
    var buttonsBlockOffset = buttonsBlock.offset();
    var buttonsPosition = buttonsBlockOffset.top;
  }
  var eventsList = $('.events_list');
  var dayHeader = $('.day_header');
  var calendarModule = $('.m__calendar_holder');
  var calendarOpenControl = $('.fx_button_date');
  var objCloseControl = $('.obj_close_btn');
  var categoriesModule = $('.m__categories_accordion');
  var categoriesOpenControl = $('.fx_button_category');
  var ENDPOINT = '//' + window.location.host + '/wp-json/events/v1/next/';

  $(window).on('resize', resize_f);
  $(window).on('scroll', scroll_f);
  headersStickyToggleShow();

  //------open-close-calendar-categories

  function resize_f() {
    headersStickyToggleShow();
    destroyModalBlocks();
  }
  function scroll_f() {
    fixedButtonsBlock();
  }
  function headersStickyToggleShow() {
    if (window_w < mobile_point) {
      initStickyHeaders();
    }
    else if (window_w > mobile_point) {
      destroyStickyHeaders();
    }
  }

  function destroyModalBlocks() {
    if (window_w > mobile_point) {
      closeObject(calendarModule, calendarOpenControl);
      closeObject(categoriesModule, categoriesOpenControl);
    }
  }

  function initStickyHeaders() {
    eventsList.stickem({offset: 83, start: 20});
  }

  function destroyStickyHeaders() {
    var sticky = eventsList.stickem({offset: 83, start: 0});
    sticky.destroy();
    dayHeader.each(function () {
      var that = $(this);
      that.removeClass('stickit');
    });
  }

  function fixedButtonsBlock() {
    var fromTop = $(window).scrollTop();

    if (fromTop > buttonsPosition) {
      $body.addClass('hasBottomBlock');
      buttonsBlock.addClass('fixedMod');
    }
    else {
      $body.removeClass('hasBottomBlock');
      buttonsBlock.removeClass('fixedMod');
    }
  }

  function openObject(openBlock, openControl) {
    openBlock.addClass('open');
    openControl.addClass('open');
    buttonsBlock.addClass('objectOpen');
  }

  function closeObject(openBlock, openControl) {
    openBlock.removeClass('open');
    openControl.removeClass('open');
    buttonsBlock.removeClass('objectOpen');
  }

  function closeSibling(siblingBlock, siblingOpenControl) {
    siblingBlock.removeClass('open');
    siblingOpenControl.removeClass('open');
  }
  
  // Load more events.
  var $loadMore = $('.get_next_events');
  
  $loadMore.on('click', function() {
    get_next_events();
  });

  function hideButton() {
    $loadMore.css('display', 'none');
  }

  var $eventsModule = $('.o__events_module');
  function get_next_events() {
    var cat = window.selectedCategoryEvents ? window.selectedCategoryEvents : 0;
    var date = parseInt($eventsModule.attr('data-selected-day'));
    if (window.selectedDateEvents) {
      // This means we're filtering from the calendar instead of the LoadMore, so we remove the button.
      date = window.selectedDateEvents;
      hideButton();
    }
    url = ENDPOINT + date +'/' + cat;
    $.ajax({
      url: url
    }).done(function(data) {
      // Update attr
      if (!data.events.length) {
        hideButton();
      } else {
        renderEventsBlock($loadMore, data);
        $eventsModule.attr('data-selected-day', data['next_timestamp']);
      }
    });
  }

  calendarOpenControl.on('click', function() {
    calendarModule.addClass('open');
    categoriesModule.removeClass('open');
  });

  categoriesOpenControl.on('click', function() {
    categoriesModule.addClass('open');
    calendarModule.removeClass('open');
  });

  objCloseControl.on('click', function() {
    closeObject($(this), calendarModule);
  });
}


function initGridSlider() {
	var first_load = false;
	var last_slider_state = false;
	var $el = $('.grid_image_slider_wrap');
	var $el_text_exist = $('.slider_text_exist');
	var $el_mobile = $('.grid_image_mobile_slider_wrap');
	if (!$el.length) {
		return;
	}

	if($el_text_exist.length){
		$el_text_exist.each(function () {
			var parent = $(this).closest('.grid_image_wrap');

			if(!parent.hasClass('text_exist')){
				parent.addClass('text_exist');
			}
		});
	}

	var el_array = [];
	var el_mobile_array = [];
	var slides_array = [];
	var slides_mobile_array = [];

	$el.each(function () {
		var $this = $(this);
		el_array.push($this);

		var grid_image_b = $this.closest('.o_grid_module').find('.grid_image_b');

		var sub_array = [];

		grid_image_b.each(function () {
			var $this = $(this);
			var sub_sub_array = {
				'dscr_text': $('.grid_image_dscr_text', $this).text(),
				'grid_image': $('.grid_image', $this).attr('src')
			};
			sub_array.push(sub_sub_array);
		});

		slides_array.push(sub_array);
	});

	$el_mobile.each(function () {
		var $this = $(this);
		el_mobile_array.push($this);

		var grid_image_b = $this.closest('.o_grid_module').find('.grid_image_b');
		var sub_array = [];

		grid_image_b.each(function () {
			var $this = $(this);
			var sub_sub_array = {
				'dscr_text': $('.grid_image_dscr_text', $this).text(),
				'grid_image': $('.grid_image', $this).attr('src')
			};
			sub_array.push(sub_sub_array);
		});

		slides_mobile_array.push(sub_array);
	});

	// $('.add-remove').slick('slickAdd','<div><h3>' + slideIndex + '</h3></div>');

	  // $('.add-remove').slick('slickRemove',slideIndex - 1);



	function sliders_f(mod) {
		if (mod == 'desktop') {
			if(last_slider_state != 'desktop') {

				if (last_slider_state == 'mobile' &&
						typeof el_mobile_array !== 'undefined' &&
						el_mobile_array.length > 0) {

					$.each(el_mobile_array, function (key, value) {
						value.slick('unslick');
					});
				}
				if (last_slider_state == 'mobile'){
					$('.grid_image_b.cloned_mod').remove();
				}
				$.each(el_array, function (key, value) {

					if (first_load) {
						value.slick('unslick');
					}
					if (last_slider_state == 'mobile') {
						$('.grid_image_b.cloned_mod', value).remove();
					}
					value.slick({
						dots: true,
						infinite: true,
						// arrows: false,
						speed: 300,
						slidesToShow: 1
					});
				});

				last_slider_state = 'desktop';
			}
		} else if (mod == 'mobile') {
			if(last_slider_state != 'mobile') {

				$.each(el_array, function (key, value) {
					if (first_load) {
						value.slick('unslick');
					}

					value.slick({
						dots: true,
						infinite: true,
						arrows: false,
						centerPadding: '30px',
						speed: 300,
						centerMode: true,
						slidesToShow: 1
					});

					$.each(slides_array[key], function (sub_key, sub_value) {
						if (sub_key < 2) {
							value.slick('slickAdd', '<figure class="grid_image_b cloned_mod">	<div class="grid_image_w"><img class="grid_image" src="' + sub_value.grid_image + '" alt=""></div><figcaption class="grid_image_dscr"><div class="grid_image_dscr_text">' + sub_value.dscr_text + '</div></figcaption></figure>');
						}
					});
				});

				if (typeof el_mobile_array !== 'undefined' &&
						el_mobile_array.length > 0){
					$.each(el_mobile_array, function (key, value) {


						if(!value.hasClass('slick-initialized')){
						value.slick({
							dots: true,
							infinite: true,
							arrows: false,
							centerPadding: '30px',
							speed: 300,
							centerMode: true,
							slidesToShow: 1
						});

						$.each(slides_mobile_array[key], function (sub_key, sub_value) {
							if (sub_key < 2) {

								value.slick('slickAdd', '<figure class="grid_image_b cloned_mod">	<div class="grid_image_w"><img class="grid_image" src="' + sub_value.grid_image + '" alt=""></div><figcaption class="grid_image_dscr"><div class="grid_image_dscr_text">' + sub_value.dscr_text + '</div></figcaption></figure>');


							}
						});
						}
					});

				}
				last_slider_state = 'mobile';
			}
		}
	}

	grid_resize();

	$window.on('resize', $.throttle(250, grid_resize));

	function grid_resize() {
		if (window_w < 701) {
			sliders_f('mobile');
		}else {
			sliders_f('desktop');
			if(!first_load){
				first_load = true;
			}
		}
	}
}

