function initHeroSlider() {
  var $slider = $('.o__hero>.hero_container>.hero_slider');

  if (!$slider.length) {
    return;
  }

  $slider.slick({
    arrows: false,
    dots: false,
    infinite: false,
    accessibility: false,
    touchMove: false,
    swipe: false,
    waitForAnimate: false
  });

  // Video changes.
  $slider.find('.slide').each(function() {
    var $video = $(this).find('video');
    if ($video.length) {
      $video.get(0).play(); // Play the mp4 video
    }

    var $iframe = $(this).find('iframe');
    if ($iframe.length) {
      if ('vimeo' === $iframe.attr('data-type')) {
        var iframe = $iframe[0],
          player = $f(iframe),
          status = $('.status');

        player.addEvent('ready', function() {
          player.api('setVolume', 0);
        });
      }
    }
  });


  // Add controls on hover
  var $controls_wrap = $('.o__hero>.hero_container>.slider_controls>.controls_wrap');
  var $controls = $controls_wrap.find('.control');
  var $indicator = $controls_wrap.find('.indicator>.actual');
  function setIndicatorWidth() {
    // Set the same width as the control div.
    if (isMobile()) {
      $indicator.css('width', $indicator.parent().next().width() / 2)
    } else {
      $indicator.css('width', $indicator.parent().next().width())
    }
  }
  setIndicatorWidth();
  $window.on('resize', setIndicatorWidth);
  $controls.each(function() {
    var $control = $(this);
    $control.mouseenter( function() {
      var nextSlide = $(this).attr('data-slide');
      $slider.slick('slickGoTo', nextSlide);
      $indicator.css('left', $(this).offset().left - $controls_wrap.offset().left);

      if (isMobile()) {
        $controls_wrap.find('.mobile').each(function() {
          var $mobile = $(this);
          nextSlide === $mobile.attr('data-slide') ? $mobile.addClass('active') :  $mobile.removeClass('active');
        })
      }
    });
  });

}

