function initNewsPages() {
  var buttonsBlock = $('.m__buttons_block_fixed');
  var yearModule = $('.m__years_accordion');
  var yearOpenControl = $('.fx_button_date');
  var objCloseControl = $('.obj_close_btn');
  var categoriesModule = $('.m__categories_accordion');
  var categoriesOpenControl = $('.fx_button_category');
  var category = 0;
  var year = 0;
  var page = 1;
  var per_page = 4;
  var template = $('.press_release').length ? 'press' : 'articles';
  var icon_pdf = $('.pdf_icon_ajax').html();

  // Filter articles by category and year.
  var ENDPOINT = '//' + window.location.host + '/wp-json/wp/v2/sun_article?';
  var url = ENDPOINT;

  $('.categories_filter').find('li>a').each(function() {
    $(this).click(function(e) {
      e.preventDefault();
      var $link = $(this);
      category = $link.attr('data-id');
      $link.addClass('active');
      $link.parent().siblings().find('a').removeClass('active');
      page = 1;
      if ('press' === template) {
        fetchPress();
      } else {
        fetchArticles();
      }
    })
  });

  $('.years_filter').find('li>a').each(function() {
    $(this).click(function(e) {
      e.preventDefault();
      var $link = $(this);
      year = $link.find('.c_year').html();
      $('.m__years_accordion').find('.year_hold').html(year);
      page = 1;
      if ('press' === template) {
        fetchPress();
      } else {
        fetchArticles();
      }
    })
  });

  function formatUrl(url) {
    var params = false;
    if (year > 0 ) {
      var from = new Date(year + '-01-01').toISOString();
      var to = new Date(year + '-12-31').toISOString();
      url += 'before=' + to + '&after=' + from;
      params = true;
    }

    if (category > 0) {
      if (params) {
        url += '&';
      }
      url += 'categories=' + category;
    }
    return url;
  }

  function fetchPress() {
    var url = '//' + window.location.host + '/wp-json/wp/v2/sun_press?';
    url = formatUrl(url);
    $.ajax({
      url: encodeURI(url)
    }).done(function(data) {
      var html = '';
      if (data.length) {
        for (var i = 0; i < data.length; i++) {
          html += renderPress(data[i]);
        }
      }

      $('.press_list').html(html);
    });
  }

  function fetchArticles() {
    url = ENDPOINT;
    url = formatUrl(url);

    $.ajax({
      url: encodeURI(url)
    }).done(function(data) {
      var html = '';
      for (var i = 0; i < data.length; i++) {
        html += renderNews(data[i])
      }
      $('.o__news_page').find('.news_list').html(html);
    });
  }

  function renderPress(data) {
    return ('<a href="' + data.acf.pdf_upload.url +  '"' +
    'target="_blank" class="press_release press_release_item">' +
      '<div class="thumbnail"' +
          'style="background-image: url(' + data.acf.press_thumbnail_image + ')"> ' +
      '<div class="overlay"></div>' +
      '<div class="icon">' +
    icon_pdf +
  '</div>' +
    '</div>' +
    '<div class="title">' +
    data.title.rendered +
  '</div>' +
    '<div class="size">' +
     data.pdf_size +
  '</div>' +
    '</a>')
  }

  function renderNews(data) {
    return ('<div class="m__content_thumb vertical_mod content_thumb_b animate-fadein" style="opacity: 1">' +
    '<div class="content_thumb_block">' +
      '<div class="content_t_img_hold" style="opacity: 1">' +
        '<img src="' + data.acf.thumbnail_list_image + '" alt="thumbnail" class="content_t_img">' +
        '</div>' +
        '<div class="content_t_desc" style="opacity: 1">' +
          '<h2 class="content_t_title"><span class="content_t_title_sub">' +
            data.title.rendered +
          '</span></h2>' +
            '<div class="content_t_date">' +
            data.date +
          '</div>' +
          '<div class="content_t_text">' +
            data.article_excerpt +
          '</div>' +
          '<a href="' + data.link + '" title="" class="a__read_more_link">' +
            'Read More' +
          '</a>' +
        '</div>' +
      '</div>' +
    '</div>');
  }

  $(window).on('resize', resize_f);
  initFixedButtonsBlock();

  initObjectFullPage(yearOpenControl, yearModule, objCloseControl, categoriesModule, categoriesOpenControl);
  initObjectFullPage(categoriesOpenControl, categoriesModule, objCloseControl, yearModule, yearOpenControl);


  function resize_f() {
    destroyModalBlocks();
    initFixedButtonsBlock();
  }

  function initFixedButtonsBlock() {
    if (isMobile()) {
      $body.addClass('hasBottomBlock');
      buttonsBlock.addClass('fixedMod');
    }
    else{
      $body.removeClass('hasBottomBlock');
      buttonsBlock.removeClass('fixedMod');
    }
  }

  function destroyModalBlocks() {
    if (!isMobile()) {
      closeObject(yearModule, yearOpenControl);
      closeObject(categoriesModule, categoriesOpenControl);
    }
  }

  function initObjectFullPage(openControl, openBlock, closeControl, siblingBlock, siblingOpenControl) {
    openControl.on('click', function () {
      var that = $(this);
      if (that.hasClass('open')) {
        closeObject(openBlock, openControl);
      }
      else {
        closeSibling(siblingBlock, siblingOpenControl);
        openObject(openBlock, openControl);
      }
    });
    closeControl.on('click', function () {
      closeObject(openBlock, openControl);
    });
  }

  function openObject(openBlock, openControl) {
    openBlock.addClass('open');
    openControl.addClass('open');
    buttonsBlock.addClass('objectOpen');
  }

  function closeObject(openBlock, openControl) {
    openBlock.removeClass('open');
    openControl.removeClass('open');
    buttonsBlock.removeClass('objectOpen');
  }

  function closeSibling(siblingBlock, siblingOpenControl) {
    siblingBlock.removeClass('open');
    siblingOpenControl.removeClass('open');
  }

}



/**
 * Protected page
 */


function protectedPageFunctions() {

  var parent = $('.o__protected_page_block');
  var fieldFocus = $('.focus_mod');
  var submitBtn = $('.submit_mod');
  var closeBtn = $('.prot_close_btn');
  var showPassBtn = $('.show_pass');
  var show = true;

  hideTitle();
  checkInputValue();
  hidePage();
  onChange();
  showPass();

  function showPass() {
    showPassBtn.on('click', function(e) {
      e.preventDefault();
      if ('' !== fieldFocus.val()) {
        fieldFocus.get(0).type = show ? 'text' : 'password';
        show = !show;
      }
    })
  }

  function onChange() {
    fieldFocus.on('input', function() {
      ('' === $(this).val()) ? submitBtn.removeClass('good_data') : submitBtn.addClass('good_data');
    })
  }


  function hideTitle() {
    fieldFocus.on('focus', function () {
      parent.addClass('focus_on');
    });
    submitBtn.on('click', function () {
      parent.removeClass('focus_on');
    });
  }

  function checkInputValue() {
    fieldFocus.blur(function () {
      if (!this.value) {
        $(this).addClass('empty').removeClass('not_empty');
      }
      else {
        $(this).addClass('not_empty').removeClass('empty');
      }
    });
  }

  function hidePage() {
    closeBtn.on('click', function () {
      parent.removeClass('show focus_on');
    });
  }

}










