/**
 * Slider quotes for Tour estate
 */


function initSliderQuotes() {
  $('.slider_quotes_list').each(
      function () {
        var thatElem = $(this);
        startSliderQuotes(thatElem);
      }
  );
}


function startSliderQuotes(sliderItem) {
  var slidesQuotesArray = [];
  var sliderDelaySeconds = 5;
  var $sliderQuotes = sliderItem;
  var sliderModule = $sliderQuotes.parent('.o__slider_quotes');
  var progress = $('.quotes_progress', sliderModule);


  if ($sliderQuotes.length < 1) {
    return;
  }
  // create Array elements-text and hide all them
  $(".slide_quotes_item", $sliderQuotes).each(function (index, elem) {
    var el = $(".slider_quotes_w", elem);
    slidesQuotesArray.push(el);
    TweenMax.set(el, {yPercent: sliderDelaySeconds, opacity: 0});

  });

  if (slidesQuotesArray.length == 1) {
    progress.hide();
  }

  //show first element-text and show progress bar
  $sliderQuotes.on('init', function (event, slick) {
    TweenMax.set(progress, {opacity: 1});
    TweenMax.to(slidesQuotesArray[0], 1, {yPercent: 0, opacity: 1});
    TweenMax.from(progress, sliderDelaySeconds, {xPercent: -100, ease: Power0.easeNone});
  });

  // init slick slider
  $sliderQuotes.slick({
    dots: false,
    arrows: false,
    infinite: true,
    speed: 1000,
    pauseOnFocus: false,
    pauseOnHover: false,
    autoplaySpeed: sliderDelaySeconds * 1000,
    autoplay: true,
    fade: true,
    cssEase: 'linear'
  });

  // there is animations with text and progress bar
  $sliderQuotes.on('beforeChange', function (event, slick, currentSlide, nextSlide) {
    TweenMax.to(progress, 1, {yPercent: -100, opacity: 0, ease: Power3.easeIn});

    TweenMax.set(slidesQuotesArray[nextSlide], {yPercent: 5, opacity: 0});
    TweenMax.to(slidesQuotesArray[currentSlide], 1, {yPercent: -5, opacity: 0, ease: Power3.easeIn});
    TweenMax.to(slidesQuotesArray[nextSlide], 1, {yPercent: 0, opacity: 1, delay: 1, ease: Power3.easeOut});

  });
  $sliderQuotes.on('afterChange', function () {
    TweenMax.set(progress, {yPercent: 0, xPercent: -100, opacity: 1});
    TweenMax.to(progress, sliderDelaySeconds, {xPercent: 0, ease: Power0.easeNone});
  });
}


