function initTwoCards() {
  var hero_cards_array = [];
  var padding = 38;
  var indent = 11;

  $('.card').each(function () {
    var $this = $(this);

    var sub_array = {
      'card': $this,
      'card_image': $('.card_image', $this),
      'title': $('.title', $this),
      'card_info': $('.card_info', $this),
      'offset': ($('.card_info', $this).height() + padding - indent)
    };
    hero_cards_array.push(sub_array);

    if(isTouchDevice() && !isTabletPortrait()){
      var unitToTop = $('.card_info', $this).height() + padding - indent;

      TweenLite.set($this, {className: '+=animate', delay: .15});
      TweenLite.to($('.title', $this), .33, {y: -unitToTop, ease: $easeInOut_1});
    }
  });

  $.each(hero_cards_array, function (key, value) {
    value.card.on(
        {
          mouseenter: function () {
            if (!isBelowTablet()) {
              TweenLite.set(value.card, {className: '+=animate', delay: .15});
              TweenLite.to(value.title, .33, {y: -value.offset, ease: $easeInOut_1});
              TweenLite.to(value.card_image, .33, {scale: 1.1});
            }
          },
          mouseleave: function () {
            if (!isBelowTablet()) {
              TweenLite.set(value.card, {className: '-=animate', delay: .33});
              TweenLite.to(value.title, .33, {y: 0, ease: $easeInOut_1});
              TweenLite.to(value.card_image, .33, {scale: 1});
            }
          }
        });
  });

  $window.on('resize', $.throttle(250, TwoCardsResize));

  function TwoCardsResize() {
    if (window_w <= 1024 && window_w > 768) {
      padding = 38;
    }
    if (window_w > 768) {
      $.each(hero_cards_array, function (key, value) {
        value.offset = value.card_info.height() + padding - indent;
      });
    }
  }


}




function initCalendar() {

  var date = new Date();
  var getCurrentMonthIndex;
  var currentMonth = date.getMonth();
  var months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];
  var selectedDate = 0;
  var selectedCategory = 0;
  window.selectedCategoryEvents = 0;
  window.selectedDateEvents = 0;
  var today = new Date();
  var $wrapper = $('.js_datepicker');
  var ENDPOINT = '//' + window.location.host + '/wp-json/events/v1/event/';
  var $eventsList = $('.events_list');
  var $eventDate = $eventsList.find('.events_item');
  var $events = $eventsList.find('.event_b_list');
  var fetching = false;
  var first = true;
  var $closedDiv = $('.a__events_closed');
  var $categories = $('.categories_list');
  var $loadmore = $('.get_next_events');

  if (!$wrapper.length) {
    return;
  }
  var template = $('.press_release').length ? 'press' : 'events';

  var $datePicker = $wrapper.datepicker({
    showOtherMonths: false,
    prevHtml: months[currentMonth - 1],
    nextHtml: months[currentMonth + 1],
    navTitles: {
      days: 'MM'
    },
    onChangeMonth: function () {
      getCurrentMonth();
      setValuePrevNextMonths();
    },
    onSelect: function(formattedDate, date, inst) {
      if (first && 'events' === template) {
        // Ignore first fetch when the date is selected an unselect default date.
        $wrapper.data('datepicker').clear();
        first = false;
        return;
      }
      if (!formattedDate || fetching) {
        return;
      }
      var timestamp = new Date(formattedDate).getTime() / 1000;
      selectedDate = timestamp;
      window.selectedDateEvents = timestamp;

      fetchEvents(timestamp);
    }
  });

  // Category filter
  $categories.find('.categories_item').each(function() {
    $(this).click(function(e) {
      e.preventDefault();
      var $cat = $(this);
      $cat.siblings().find('a').removeClass('active');
      $cat.find('a').addClass('active');
      selectedCategory = parseInt($cat.find('a').attr('data-id'));
      window.selectedCategoryEvents = selectedCategory;
      fetchEvents(selectedDate, selectedCategory);
    });
  });

  // Init datepicker in today's date.
  if ( 'events' === template ) {
    $datePicker.data('datepicker').selectDate(new Date());
  }

  function fetchEvents(timestamp, category) {
    fetching = true;
    $loadmore.css('display', 'none'); // Hide loadmore button if we use a different filter.
    var url = ENDPOINT + timestamp + '/';
    if (!category) {
      category = 0;
    }
    url += category + '/';
    $.ajax({
      url: url
    }).done(function(data) {
      renderEvents(data);
      fetching = false;
    })
  }

  /**
   * Render events in the HTML.
   * @param data
   */
  function renderEvents(data) {
    // Render selected date
    $eventDate.find('.day_hold').html(data.formatted_date);
    $eventDate.find('.day_note').html('');
    $events.html('');
    var html = '';
    if (data.events.length) {
      for (var i = 0; i < data.events.length; i++) {
        html += renderSingleEvent(data.events[i]);
      }
      $closedDiv.css('display', 'none');
    } else {
      $closedDiv.css('display', 'block');
      $eventsList.find('li:not(:first)').remove();
    }

    $events.html(html);
  }


  function getCurrentMonth() {
    var navTitle = $('.datepicker--nav-title').text();
    var indexComma = navTitle.split("").indexOf(',');

    //get nav title text if title has year or hasnt year
    var getCurrentMonthText = indexComma > 0 ? navTitle.slice(0, indexComma) : navTitle;

    getCurrentMonthIndex = months.indexOf(getCurrentMonthText);

  }

  function setValuePrevNextMonths() {
    var navNextCell = $('.datepicker--nav-action[data-action="next"]');
    var navPrevCell = $('.datepicker--nav-action[data-action="prev"]');
    // set value for nav cells
    //IFS - december to january or january to december

    if (getCurrentMonthIndex == 11) {
      navNextCell.text(months[0]);
    }
    else {
      navNextCell.text(months[getCurrentMonthIndex + 1]);
    }

    if (getCurrentMonthIndex == 0) {
      navPrevCell.text(months[11]);
    }
    else {
      navPrevCell.text(months[getCurrentMonthIndex - 1]);
    }
  }
};

