function initContentThumbAnimation() {
	var thumbArray = [];
	var OFFSET = 0.75;
	var COLUMNS = 3;

	$(window).on('load', function () {
		$('.content_thumb_b').each(function (index, elem) {
			var that = $(this);
			var sub_array;
			TweenMax.set(that, {opacity: 1});
			if(that.hasClass('horizontal_mod')){
				sub_array = {
					el: that,
					image: TweenMax.from($('.content_t_img_hold', that), .3, {
						opacity: 0,
						delay: .1,
						ease: Power2.easeOut,
						paused: true
					}),
					text: TweenMax.from($('.content_t_desc', that), .6, {
						opacity: 0,
						xPercent: 15,
						delay: .4,
						ease: Power2.easeOut,
						paused: true
					}),
					position: that.offset().top,
					isShown: false
				};
			}else {
				sub_array = {
					el: that,
					image: TweenMax.from($('.content_t_img_hold', that), .3, {
						opacity: 0,
						ease: Power2.easeOut,
						paused: true
					}),
					text: TweenMax.from($('.content_t_desc', that), .6, {
						opacity: 0,
						yPercent: 15,
						delay: .3,
						ease: Power2.easeOut,
						paused: true
					}),
					position: that.offset().top,
					isShown: false
				};
			}
			thumbArray.push(sub_array);
		});
		page_load = true;
		animation();
	});

	$(window).on('resize', $.throttle(250, resize));

	function resize(){
		$.each(thumbArray, function (index, elem) {
			elem.position = elem.el.offset().top;
		});
	}

	$(window).on('scroll', animation);

	function animation() {
		if (page_load) {
			$.each(thumbArray, function (index, elem) {
        if ( index < COLUMNS && ! elem.isShown ) {
					anim_start(elem);
					elem.isShown = true;
        } else if ( ($scrollTopGl + window_h * OFFSET) > elem.position) {
					// elem.position

					if (!elem.isShown) {
						if(index > 0 && elem.position == thumbArray[index-1].position){
							if(index > 1 && elem.position == thumbArray[index-2].position){
								TweenMax.delayedCall(.2, function () {
									anim_start(elem);
								});
							}else {
								TweenMax.delayedCall(.1, function () {
									anim_start(elem);
								});
							}

						}else {
							anim_start(elem);
						}
						elem.isShown = true;
					}
				}
			});
		}
	}

	function anim_start(element) {
		element.image.play();
		element.text.play();
	}

}


